const MultiStepIndicator = ({index}) => {
  return (
    <nav>
      <ol className="cd-breadcrumb triangle">
        <li className={ index === 0 ? "current" : "" }><a href="#0">Seus dados</a></li>
        <li><a href="#0">Planos</a></li>
        <li><a href="#0">Pagamento</a></li>
        {/*<li className="current"><em>Project</em></li>*/ }
      </ol>
    </nav>
  )
}


export default MultiStepIndicator
